import React, { useEffect , useState} from 'react'
import FetchUpComingQuery from '../../hooks/getUpComing'
import Year from '../../dashboard/Radios/year'
import Country from '../../dashboard/Radios/country'
import Genre from '../../dashboard/Radios/genre'
import Quality from '../../dashboard/Radios/quality'
import Rating from '../../dashboard/Radios/rating'
import Release from '../../dashboard/Radios/release'
import Type from '../../dashboard/Radios/type'
import Loader from "react-loader-spinner"


export default function NewReleased(){
    const { isLoading, isFetching, data } = FetchUpComingQuery()
    const [isOpen, setIsopen] = useState(false)
    const [country, setCountry] = useState(false)
    const [genre, setGenre] = useState(false)
    const [quality, setQulaity] =useState(false)
    const [rating, setRating] = useState(false)
    const [releasing, setReleasing] = useState(false)
    const [type, setType] = useState(false)
    const [year, setYear ] = useState(false)
    const [onTogglin, setongglin] = useState('')
    const buttonStyle = 'rounded bg-[#1a212d] ml-2 my-2 px-2 text-center text-[#605f62] h-[30px] font-light text-[12px]'


    const  justToggle = (names:any)=>{
        setIsopen(names)

    }

    const HandleCountry = ()=>{
        setCountry(!country)
    }

    const HandleGenre = ()=>{
        setGenre(!genre)
    }

    const HandleQuality = ()=>{
        setQulaity(!quality)
    }

    const HandleRating = ()=>{
        setRating(!rating)
    }

    const HandleReleasing = ()=>{
        setReleasing(!releasing)
    }

    const HandleType = ()=>{
        setType(!type)
    }

    const HandleYear = ()=>{
        setYear(!year)
    }


    const thumbnailUrls = [
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png',
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png',
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png',
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png',
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png',
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png',
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png',
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png',
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png',
        'https://theperfectroundgolf.com/wp-content/uploads/2022/04/placeholder.png'

    ]

  return (
    <div className='bg-[#020916] pt-10'>
        <p>NEW RELEASE</p>


        <div className='flex flex-wrap'>
            <div className='w-3/4'>
                <div className='flex pl-2'>
                    <div className=' h-[30px] '>
                        <input 
                        type="text" 
                        placeholder='search...'
                        className='text-[#605f62] bg-[#1a212d] w-[120px] rounded mr-2 h-[30px] text-center'
                        />
                    </div>

                        <Year isOpen={isOpen} onToggle={HandleYear}/>
                        <Country isOpen={isOpen} onToggle={HandleCountry}/>
                        <Genre isOpen={isOpen} onToggle={HandleGenre}/>}
                        <Quality isOpen={isOpen} onToggle={HandleQuality}/>
                      {<Rating isOpen={isOpen} onToggle={HandleRating}/>}
                        {<Release isOpen={isOpen} onToggle={HandleReleasing}/>}
                       {<Type isOpen={isOpen} onToggle={HandleType}/>}
                        <button 
                              data-dropdown-toggle="dropdownDefaultRadio" className="text-white bg-blue-700 h-[30px] ml-2
                              font-medium rounded-lg text-sm px-4 py-2.5 text-center inline-flex items-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800" type="button">filter
                            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" className="w-4 h-4 ml-4">
                              <path stroke-linecap="round" stroke-linejoin="round" d="M16.023 9.348h4.992v-.001M2.985 19.644v-4.992m0 0h4.992m-4.993 0l3.181 3.183a8.25 8.25 0 0013.803-3.7M4.031 9.865a8.25 8.25 0 0113.803-3.7l3.181 3.182m0-4.991v4.99" />
                           </svg>
                        </button>
                </div>
                    {/* okay let go */}

                    <div className="flex flex-wrap">
                            {thumbnailUrls.map((url, index) => (
                                <div key={index} className="w-1/2 sm:w-1/3 md:w-1/4 lg:w-1/6 p-2">
                                    <img className="w-full h-auto" src={url} alt={`Thumbnail ${index + 1}`} />
                                </div>
                            ))}
                     </div>






            </div>
            <div className="w-1/4">
                        <div className="h-full">
                            {/* Place your text content here */}
                            <div className='flex pt-[210px] pl-[5px] font-extrabold'>
                                <p className='pl-4 text-white font-extrabold text-[24px]'>UPDATED</p>
                                <div className=' ml-10 text-center pl-[70px]'>
                                    <button className=' w-[70px] text-center text-[#605f62] h-[30px] bg-[#1a212d] rounded-md flex pl-[9px] font-medium text-[12px] pt-[5px]'>
                                        More 
                                        <span>
                                           <svg xmlns="http://www.w3.org/2000/svg" height="28" viewBox="0 -960 960 960" width="28" className='pb-2 text-base font-semibold'>
                                             <path d="m375-240-43-43 198-198-198-198 43-43 241 241-241 241Z"/>
                                            </svg>
                                        </span>
                                        <span className='bg-red-400'>
                                        </span>
                                    </button>
                                </div>

                            </div>

                            {/* The code on the update part */}
                            <div className='pl-[5px] pt-[65px] '>



                                    <div className="flex-col w-[280px] h-[70px] mt-[2px] bg-[#020916] text-white  border-2 border-zinc-700 border-solid rounded-md ">
                                            <div className='flex'>
                                                    <img src="https://storage.googleapis.com/proudcity/mebanenc/uploads/2021/03/placeholder-image.png" alt="" 
                                                      className='w-10 h-[60px] md:32 pl-2 pt-2 rounded-md text-center'/>
                                                      <p className='pt-2 pl-2 truncate'>title</p>    
                                            </div>
                                        </div>

                            </div>
                        </div>
                    </div>
        </div>
    </div>
  )
}
